<p>Something like this in the Robot constructor:</p>
<pre data-code-wrap="java"><code class="lang-java">Shuffleboard.getTab("Main").addCamera("camera", "camera", new String[] {"http://.../stream.mjpg"});
</code></pre>
<p>Note this will put the camera on a separate tab.  Unfortunately, I don’t believe shuffleboard has a way to just display a raw URL camera stream without using a code-driven layout or using the camera list, but using CameraServer with a HttpCamera should work to get the camera added to the Shuffleboard camera list:</p>
